import React from 'react';

const Team: React.FC = () => {
  const teamMembers = [
    {
      name: "Zoran Sarabaca",
      image: "/images/57 Zoran Sarabaca-Xcllusive Headshots Mar 2021_Noni Carroll Photography.jpg",
      description: "Expert in business valuations with over 15 years of experience in M&A and corporate finance."
    },
    {
      name: "Business Valuation Experts",
      image: "/images/129 Xclussive Business Sales Headshots Newcastle Feb 2022_ Noni Carroll Photography.jpg",
      description: "Specialist in legal proceedings and dispute resolution valuations."
    },
    {
      name: "Senior Consultants",
      image: "/images/152  Xclussive Headshots Newcastle Feb 2022_ Noni Carroll Photography.jpg",
      description: "Focused on exit strategies and succession planning for business owners."
    }
  ];

  return (
    <div className="py-16">
      <div className="container">
        <h1 className="text-4xl font-bold text-center mb-12">Our Team</h1>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {teamMembers.map((member, index) => (
            <div key={index} className="bg-white rounded-lg overflow-hidden shadow-md">
              <img 
                src={member.image} 
                alt={member.name}
                className="w-full h-64 object-cover"
              />
              <div className="p-6">
                <h3 className="text-xl font-semibold mb-2">{member.name}</h3>
                <p className="text-gray-600">{member.description}</p>
              </div>
            </div>
          ))}
        </div>

        <div className="mt-16 max-w-3xl mx-auto text-center">
          <h2 className="text-2xl font-semibold mb-6">Expert Business Valuers</h2>
          <p className="text-gray-600 mb-8">
            Our team combines deep technical knowledge with practical business experience
            to deliver accurate and reliable business valuations.
          </p>
          <a href="/contact" className="btn btn-primary">
            Work With Us
          </a>
        </div>
      </div>
    </div>
  );
};

export default Team;
